import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <nav className="navbar">
           <h1>My Blog</h1>
           <div className="links">
               <Link to="/">Home</Link>
               <Link to="/create">new Blog</Link>
               <Link to="/firstTry">My First Try </Link>
               <Link to="/buttons">Buttons tuto </Link>
               <Link to="/counter">Counter </Link>



           </div>
        </nav>
     );
}
 
export default Navbar;
